import { DrawerActions, NavigationContainer, useNavigation } from "@react-navigation/native";
import { NavigationAction } from '@react-navigation/native';
import {
  StackNavigationProp,
  createStackNavigator,
} from "@react-navigation/stack";
import React from "react";
import RootStackParams from "../models/RootStackParams";
import HomeScreen from "../screen/HomeScreen";
import { DrawerNavigationProp, createDrawerNavigator } from "@react-navigation/drawer";
import ProfileScreen from "../screen/ProfileScreen";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import Favorites from "../screen/Favorites";
import { MaterialCommunityIcons } from '@expo/vector-icons';
import ROUTES from "./routes";
import { useSelector } from "react-redux";
import { BookmarkProps } from "../redux/actions/bookmarkActions";
import Login from "../screen/Login";
import SignUp from "../screen/SignUp";
import { AccountProps } from "../redux/actions/accountActions";
import Editor from "../screen/Editor";
import Personal from "../screen/Personal";
import { useRoute } from '@react-navigation/native';

const RootStack = createStackNavigator<RootStackParams>();
const Drawer = createDrawerNavigator();
const Tab = createBottomTabNavigator();




const HomeStack: React.FC = () => {
  return (
    <RootStack.Navigator>
      <RootStack.Screen
        name={ROUTES.HomeScreen}component={HomeScreen}
        options={{headerShown: false,headerStyle: { backgroundColor: "rgb(79,172,217)" }, }} />
      <RootStack.Screen name={ROUTES.Profile} component={ProfileScreen} 
      options={{headerShown: false,headerStyle: { backgroundColor: "rgb(79,172,217)" }, }}/>
      <RootStack.Screen name={ROUTES.Favorite} component={Favorites}
      options={{headerShown: false,headerStyle: { backgroundColor: "rgb(79,172,217)" }, }} />
      <RootStack.Screen name={ROUTES.Editor} component={Editor} 
      options={{headerShown: false,headerStyle: { backgroundColor: "rgb(79,172,217)" }, }}/>
      <RootStack.Screen name={ROUTES.Personal} component={Personal} 
      options={{headerShown: false,headerStyle: { backgroundColor: "rgb(79,172,217)" }, }}/>

    </RootStack.Navigator>
  );
};

const MainStack: React.FC = () => {
  return (
    <RootStack.Navigator>
      <RootStack.Screen name={ROUTES.Login}component={Login}options={{headerShown: false,headerStyle: { backgroundColor: "rgb(79,172,217)" },}}/>
      <RootStack.Screen name={ROUTES.SignUp} component={SignUp} options={{headerShown: false,headerStyle: { backgroundColor: "rgb(79,172,217)" },}}/>
    </RootStack.Navigator>
  );
};

const TabNavigation: React.FC = () => {
  const { bookmarks } = useSelector(
    (state: { bookmarkReducer: BookmarkProps }) => state.bookmarkReducer
  );
  const {navigate} = useNavigation<StackNavigationProp<RootStackParams, ROUTES>>();  
  const navigation = useNavigation<StackNavigationProp<RootStackParams, ROUTES>>();  
  navigation.dispatch(DrawerActions.openDrawer());
  const route = useRoute();
  const shouldOpenDrawer = route.name === ROUTES.Profile;

  React.useEffect(() => {
    if (shouldOpenDrawer) {
      navigation.dispatch(DrawerActions.openDrawer());
    }
  }, [shouldOpenDrawer]);

  return (
    <Tab.Navigator
      initialRouteName={ROUTES.HomeScreen}
      screenOptions={{
        tabBarActiveTintColor: "#fc8386",
        tabBarInactiveTintColor: "gray",
      }}
    >
      <Tab.Screen
        name={ROUTES.HomeScreen}
        component={HomeScreen}
        listeners={{ tabPress: () => { navigate("HomeScreen"); } }}
        options={{
          headerShown: false,
          tabBarLabel: "Home",
          tabBarIcon: ({ color, size }) => (
            <MaterialCommunityIcons name="home" color={color} size={size} />
          ),
        }}

      />
      <Tab.Screen
        name={ROUTES.HomeScreen}
        component={HomeScreen}
        listeners={{ tabPress: () => { navigation.dispatch(DrawerActions.openDrawer()) } }}
        options={{
          headerShown: false,
          tabBarLabel: "Profile",
          tabBarIcon: ({ color, size }) => (
            <MaterialCommunityIcons name="details" color={color} size={size} />
          ),
        }}
      />

    </Tab.Navigator>
  );
};



const DrawerMenu: React.FC = () => {
  const { account } = useSelector(
    (state: { accountReducer: AccountProps }) => state.accountReducer
  );

  return (
    <NavigationContainer>
      {account && account.isLogged ? (
        <Drawer.Navigator>
          <Drawer.Screen
            name="TabNavigation"
            component={TabNavigation}
            options={{
              headerShown: true,
              headerTintColor: "red",
              headerStyle: { backgroundColor: "#fc8386" },
              drawerLabel: "Tab Navigation",
              drawerIcon: ({ color, size }) => (
                <MaterialCommunityIcons
                  name="view-grid"
                  color={color}
                  size={size}
                />
              ),
            }}
          />
          <Drawer.Screen
            name={ROUTES.Editor}
            component={Editor}
            options={{
              headerShown: true,
              headerTintColor: "red",
              headerStyle: { backgroundColor: "#fc8386" },
              drawerIcon: ({ color, size }) => (
                <MaterialCommunityIcons name="home" color={color} size={size} />
              ),
              drawerLabel: "Info Developer",
            }}
          />
          <Drawer.Screen
            name={ROUTES.Personal}
            component={Personal}
            options={{
              headerShown: true,
              headerTintColor: "red",
              headerStyle: { backgroundColor: "#fc8386" },
              drawerIcon: ({ color, size }) => (
                <MaterialCommunityIcons
                  name="details"
                  color={color}
                  size={size}
                />
              ),
              drawerLabel: "Personal Area",
            }}
          />
          <Drawer.Screen
            name={ROUTES.Favorite}
            component={Favorites}
            options={{
              headerShown: true,
              headerTintColor: "red",
              headerStyle: { backgroundColor: "#fc8386" },
              drawerIcon: ({ color, size }) => (
                <MaterialCommunityIcons
                  name="bookmark"
                  color={color}
                  size={size}
                />
              ),
              drawerLabel: "Favorite",
            }}
          />
        </Drawer.Navigator>
      ) : (
        <MainStack />
      )}
    </NavigationContainer>
  );
};

export default DrawerMenu;
